import React from 'react'
import { Heading, Button, Grid, GridItem } from '@chakra-ui/react'

const Dashboard = () => {
  return (
    <div className='page' style={{ paddingTop: '8rem' }}>
      <Button colorScheme="primary">Start a new category</Button>
      <Heading marginTop='1rem'>Your projects</Heading>
      <Grid
        marginTop='2rem'
        width='100%'
        flexGrow={1}
        templateColumns='repeat(5, 1fr)'
        gap={4}
      >

      </Grid>
    </div>
  )
}

export default Dashboard
